import React, { Component } from 'react';
import './App.css';
import Sky from 'react-sky';
import banana from './Components/Pics/banana.png';
import duck from './Components/Pics/duck.png';
import star from './Components/Pics/star.png';
import mouse from './Components/Pics/mouse.png';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank';


class App extends Component {
  render(){
    return (
      <div className="App">
        <Sky
          images={{
            /* FORMAT AS FOLLOWS */
            0: banana,
            1: duck,
            2: star,
            3: mouse,
          }}
          how={100} /* Pass the number of images Sky will render chosing randomly */
          time={2} /* time of animation */
          size={'100px'} /* size of the rendered images */
          background={'palettedvioletred'} /* color of background */
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
        {/* <FaceRecognition /> */}
      </div>
     );
  }
}
export default App;
